import React, { Component, Fragment } from 'react';
import {Input, Button} from './component/input';
import Box from './component/box';
import './App.css';

class App extends Component{
  render () {
  return (
    <Fragment>
      <Box className="leftSide"/>
        <Box className="blueBox"/>
          <div className="blueCircle"></div>
        <Box className="whiteBox"/>
          <div className="userName">Jason Kang</div>
          <div className="profile">@jkang14</div>
          <div className="userInfo-container">
            <span className="userInfo tweets">Tweets</span>
            <span className="userInfo following">Following</span>
            <span className="userInfo follower">Followers</span>
          <div className="count-container">
            <span className="count tweetCount">0</span>
            <span className="count followingCount">1</span>
            <span className="count followerCount">1</span> 
          </div>
      </div>
      <Box className="rightSide"/>
        <div className="enterNewTweet">
          <Input placeholder="What's happening?" className="newMessage"/>
          <Button className="make-btn" innerHTML="tweet"/>
        </div>
        <div className="showTweets">
          <ul className="tweetList">
            <div className="noTweet"></div>
          </ul>
        </div>
        </Fragment>
    );
  }
}

export default App;
